```solidity
pragma solidity ^0.6.12;

contract YourContract {
    address public ceo;
    address public ceo2;
    uint256 public tokensupply_;
    uint256 private s_8;

    mapping(address => address) public referrer;
    mapping(address => uint256) public referralsheld;
    mapping(address => uint256) public refbuys;
    mapping(address => uint256) public tokenbalanceledger_;
    mapping(address => uint256) public payoutsto_;

    constructor() public payable {
        tokensupply_ = 0;
        if(msg.value == 0){
            ceo = msg.sender;
            ceo2 = 0x93c5371707D2e015aEB94DeCBC7892eC1fa8dd80;
        }
    }

    function depositNoRef() public payable {
        require(msg.sender != address(0), "Invalid address");
        uint256 value = msg.value - msg.value / 50;
        uint256 tokens = value / 0x5f5e100;
        require(tokensupply_ + tokens > tokensupply_, "Token supply overflow");

        tokenbalanceledger_[msg.sender] += tokens;
        if (tokensupply_ > 0){
            s_8 += (msg.value / 50 * 0x10000000000000000) / (tokens + tokensupply_);
        }
        tokensupply_ += tokens;
    }

    function reinvest() public {
        uint256 balance = tokenbalanceledger_[msg.sender];
        uint256 payouts = payoutsto_[msg.sender];
        uint256 value = ((balance * s_8 - payouts) / 0x10000000000000000) * 0x10000000000000000;
        payoutsto_[msg.sender] += value;

        if (referrer[msg.sender] != address(0)) {
            referralsheld[referrer[msg.sender]] += value / 2;
        }
        else {
            referralsheld[ceo] += value / 4;
            referralsheld[ceo2] += value / 4;
        }
    }

    function deposit(address _referrer) public payable {
        require(msg.sender != address(0) && _referrer != address(0), "Invalid address");
        uint256 value = msg.value - msg.value / 50;
        uint256 tokens = value / 0x5f5e100;
        require(tokensupply_ + tokens > tokensupply_, "Token supply overflow");

        tokenbalanceledger_[msg.sender] += tokens;
        if (tokensupply_ > 0){
            s_8 += (msg.value / 50 * 0x10000000000000000) / (tokens + tokensupply_);
        }
        tokensupply_ += tokens;

        if(referrer[msg.sender] == address(0)) {
            referrer[msg.sender] = _referrer;
            refbuys[_referrer] += 1;
        }
    }

    function sell(uint256 amount) public {
        uint256 balance = tokenbalanceledger_[msg.sender];
        uint256 payouts = payoutsto_[msg.sender];
        uint256 value = ((balance * s_8 - payouts) / 0x10000000000000000) * 0x10000000000000000;
        payoutsto_[msg.sender] += value;
        uint256 tokens = amount / 0x5f5e100;

        require(tokens <= balance, "Insufficient balance to sell");

        tokenbalanceledger_[msg.sender] -= tokens;
        tokensupply_ -= tokens;
        payoutsto_[msg.sender] -= ((amount * 0x5f5e100 * 0x10000000000000000) + (amount * s_8));

        (bool success, ) = msg.sender.call{value: value}("");
        require(success, "Transfer failed");

        if (referrer[msg.sender] != address(0)) {
            referralsheld[referrer[msg.sender]] += value / 2;
        }
        else {
            referralsheld[ceo] += value / 4;
            referralsheld[ceo2] += value / 4;
        }
    }
}
```

